import React from "react";
import "./navbar.css";
export default function Navbar() {
  return (
    <div className="navbar">
      <ul>
        <li>
          <a> Home </a>
        </li>
        <li>
          <a> Blog</a>
        </li>
        <li></li>
      </ul>
    </div>
  );
}
